def merge_the_tools(string, k):
    step=len(string)//k

    
    for i in range(0,len(string),step):
        m=""
        a=string[i:i+step]
        for j in a:
            if j not in m:
                m+=j
        
        print(m)
    
merge_the_tools(""
,6623)
